import React, {useState, FC} from 'react'
import { useAppSelector } from '../app/hooks';
  
export const MakeTerraformFile: FC = () => {
  const setVpcName = useAppSelector((state) => state.vpcName)
  return (
    <>
      <p>Hello, world</p>
      <p>{ setVpcName }</p>
      <a href="/">戻る</a>
    </>
  );
  }
